import React , { useContext} from 'react';
import { FaUserAlt } from 'react-icons/fa';
import { FiShoppingCart } from 'react-icons/fi';
import { Link } from 'react-router-dom';
import './styleHeader.css';
import { GlobalState } from '../GlobalState';

//vd 

const Header = () => {
    const value = useContext(GlobalState)
  return (
    <nav className='nav-bar'>
      <div className='logo'><Link to="/" className='list-item__link'>Logo</Link></div>
      <ul className='nav-bar__list'>
        <li className='list-item'><Link className='list-item__link' to="/products">Product</Link></li>
        <li className='list-item'><Link className='list-item__link' to="/about">About</Link></li>
        <li className='list-item'><Link className='list-item__link' to="/contact">Contact</Link></li>
      </ul>
      <ul className='icons'>
          <li className='list-item'>
            <Link to="/register" >
              <FaUserAlt size={24} className='list-item__link'/>
            </Link>
          </li >
          <li className='list-item' style={{display: 'flex'}}>
            <Link to="/cart"><FiShoppingCart size={24} className='list-item__link'/></Link>
            <span style={{color: "white" , paddingLeft: "10px"}}>(0)</span>
            </li>
      </ul> 
      <div style={{color: "white"}}>{value}</div>
    </nav>
  )
}

export default Header
